import React, { FC } from "react";

interface IProductGallery {
  hasMultipleImages: boolean;
  images: any[];
}

const ProductGallery: FC<IProductGallery> = ({ hasMultipleImages }) => {
  if (hasMultipleImages) {
    return <p>Multiple</p>;
  }

  return (
    <>
      <p>Single or none</p>
    </>
  );
};

export default ProductGallery;
